import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

const Home = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6 }
  };

  return (
    <div className="min-h-screen bg-background-light pt-20">
      {/* Hero Section */}
      <section className="relative bg-gradient-to-r from-primary to-primary-dark text-white py-20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div 
            className="text-center"
            initial={fadeIn.initial}
            animate={fadeIn.animate}
            transition={fadeIn.transition}
          >
            <h1 className="text-4xl md:text-6xl font-bold mb-6">
              Revolutionizing Fresh Produce Packaging
            </h1>
            <p className="text-xl md:text-2xl mb-8 max-w-3xl mx-auto">
              A research-driven sustainable solution to reduce post-harvest losses in papayas and promote eco-friendly alternatives.
            </p>
            <div className="space-x-4">
              <Link to="/research" className="inline-block bg-accent hover:bg-accent-dark text-white font-bold py-3 px-8 rounded-lg transition duration-300">
                View Research
              </Link>
              <Link to="/impact" className="inline-block border-2 border-white text-white hover:bg-white hover:text-primary font-bold py-3 px-8 rounded-lg transition duration-300">
                Our Impact
              </Link>
            </div>
          </motion.div>
        </div>
      </section>

      {/* Features Section */}
      <section className="py-20 bg-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center mb-16">
            <h2 className="text-3xl font-bold text-gray-900 mb-4">Key Features</h2>
            <p className="text-xl text-gray-600">Discover how The Green Crate combines innovation with sustainability</p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            <motion.div 
              className="bg-background-light p-8 rounded-lg shadow-sm"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.2 }}
            >
              <div className="text-4xl mb-4">🌱</div>
              <h3 className="text-xl font-semibold text-gray-900 mb-4">Biodegradable Material</h3>
              <p className="text-gray-600">Made from sustainable bamboo fibers, ensuring complete biodegradability while maintaining durability.</p>
            </motion.div>

            <motion.div 
              className="bg-background-light p-8 rounded-lg shadow-sm"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.4 }}
            >
              <div className="text-4xl mb-4">🔬</div>
              <h3 className="text-xl font-semibold text-gray-900 mb-4">Antimicrobial Coating</h3>
              <p className="text-gray-600">Innovative citric and lactic acid treatment prevents microbial growth and extends produce shelf life.</p>
            </motion.div>

            <motion.div 
              className="bg-background-light p-8 rounded-lg shadow-sm"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.6 }}
            >
              <div className="text-4xl mb-4">📊</div>
              <h3 className="text-xl font-semibold text-gray-900 mb-4">Proven Results</h3>
              <p className="text-gray-600">20% reduction in weight loss and significant decrease in microbial activity during storage.</p>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Research Preview Section */}
      <section className="py-20 bg-background-light">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div 
            className="max-w-3xl"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            viewport={{ once: true }}
          >
            <h2 className="text-3xl font-bold text-gray-900 mb-6">Research-Backed Innovation</h2>
            <p className="text-xl text-gray-600 mb-8">Our solution is the result of extensive scientific research and testing, focusing on addressing real-world challenges in the fresh produce industry.</p>
            <Link to="/research" className="inline-block bg-primary hover:bg-primary-dark text-white font-bold py-3 px-8 rounded-lg transition duration-300">
              Learn More
            </Link>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default Home;
